1	Martin Scorsese	data:image/png;base64,	Martin Charles Scorsese was born on November 17, 1942 in Queens, New York City, to Catherine Scorsese (née Cappa) and Charles Scorsese, who both worked in Manhattan s garment district, and whose families both came from Palermo, Sicily. He was raised in the neighborhood of Little Italy, which later provided the inspiration for several of his films. Scorsese earned a B.S. degree in film communications in 1964, followed by an M.A. in the same field in 1966 at New York University s School of Film. During this time, he made numerous prize-winning short films including The Big Shave (1967), and directed his first feature film, Who s That Knocking at My Door (1967).\n\nHe served as assistant director and an editor of the documentary Woodstock (1970) and won critical and popular acclaim for Mean Streets (1973), which first paired him with actor and frequent collaborator Robert De Niro. In 1976, Scorsese s Taxi Driver (1976), also starring De Niro, was awarded the Palme d Or at the Cannes Film Festival, and he followed that film with New York, New York (1977) and The Last Waltz (1978). Scorsese directed De Niro to an Oscar-winning performance as boxer Jake LaMotta in Raging Bull (1980), which received eight Academy Award nominations, including Best Picture and Best Director, and is hailed as one of the masterpieces of modern cinema. Scorsese went on todirect The Color of Money (1986), The Last Temptation of Christ (1988), Goodfellas (1990), Cape Fear (1991), The Age of Innocence (1993), Casino (1995) and Kundun (1997), among other films. Commissioned by the British Film Institute to celebrate the 100th anniversary of the birth of cinema, Scorsese completed the four-hour documentary, A Personal Journey with Martin Scorsese Through American Movies (1995), co-directed by Michael Henry Wilson.\n\nHis long-cherished project, Gangs of New York (2002), earned numerous critical honors, including a Golden Globe Award for Best Director; the Howard Hughes biopic El aviador (2004) won five Academy Awards, in addition to the Golden Globe and BAFTA awards for Best Picture. Scorsese won his first Academy Award for Best Director for The Departed (2006), which was also honored with the Director s Guild of America, Golden Globe, New York Film Critics, National Board of Review and Critic s Choice awards for Best Director, in addition to four Academy Awards, including Best Picture. Scorsese s documentary of the Rolling Stones in concert, Shine a Light (2008), followed, with the successful thriller Shutter Island (2010) two years later. Scorsese received his seventh Academy Award nomination for Best Director, as well as a Golden Globe Award, for Hugo (2011), which went on to win five Academy Awards.\n\nScorsese also serves as executive producer on the HBO series Boardwalk Empire (2010) for which he directed the pilot episode. Scorsese s additional awards and honors include the Golden Lion from the Venice Film Festival (1995), the AFI Life Achievement Award (1997), the Honoree at the Film Society of Lincoln Center s 25th Gala Tribute (1998), the DGA Lifetime Achievement Award (2003), The Kennedy Center Honors (2007) and the HFPA Cecil B. DeMille Award (2010). Scorsese and actor Leonardo DiCaprio have worked together on five separate occasions: Gangs of New York (2002), El aviador (2004), The Departed (2006), Shutter Island (2010) and The Wolf of Wall Street (2013).\n
2	Steven Spielberg	data:image/png;base64,	One of the most influential personalities in the history of cinema, Steven Spielberg is Hollywood s best known director and one of the wealthiest filmmakers in the world. He has an extraordinary number of commercially successful and critically acclaimed credits to his name, either as a director, producer or writer since launching the summer blockbuster with Jaws (1975), and he has done more to define popular film-making since the mid-1970s than anyone else.\n\nSteven Allan Spielberg was born in 1946 in Cincinnati, Ohio, to Leah Frances (Posner), a concert pianist and restaurateur, and Arnold Spielberg, an electrical engineer who worked in computer development. His parents were both born to Russian Jewish immigrant families. Steven spent his younger years in Haddon Township, New Jersey, Phoenix, Arizona, and later Saratoga, California. He went to California State University Long Beach, but dropped out to pursue his entertainment career. He gained notoriety as an uncredited assistant editor on the classic western Wagon Train (1957). Among his early directing efforts were Battle Squad (1961), which combined World War II footage with footage of an airplane on the ground that he makes you believe is moving. He also directed Escape to Nowhere (1961), which featured children as World War Two soldiers, including his sister Anne Spielberg, and The Last Gun (1959), a western. All of these were short films. The next couple of years, Spielberg directed a couple of movies that would portend his future career in movies. In 1964, he directed Firelight (1964), a movie about aliens invading a small town. In 1967, he directed Slipstream (1967), which was unfinished. However, in 1968, he directed Amblin  (1968), which featured the desert prominently, and not the first of his movies in which the desert would feature so prominently. Amblin  also became the name of his production company, which turned out such classics as E.T. The Extra-Terrestrial (1982). Spielberg had a unique and classic early directing project, Duel (1971), with Dennis Weaver. In the early 1970s, Spielberg was working on TV, directing among others such series as Rod Serling s Night Gallery (1969), Marcus Welby, M.D. (1969) and Columbo: Murder by the Book (1971). All of his work in television and short films, as well as his directing projects, were just a hint of the wellspring of talent that would dazzle audiences all over the world.\n\nSpielberg s first major directorial effort was The Sugarland Express (1974), with Goldie Hawn, a film that marked him as a rising star. Itwas his next effort, however, that made him an international superstar among directors: Jaws (1975). This classic shark attack tale started the tradition of the summer blockbuster or, at least, he was credited with starting the tradition. His next film was the classic Close Encounters of the Third Kind (1977), a unique and original UFO story that remains a classic. In 1978, Spielberg produced his first film, the forgettable I Wanna Hold Your Hand (1978), and followed that effort with Used Cars (1980), a critically acclaimed, but mostly forgotten, Kurt Russell\\Jack Warden comedy about devious used-car dealers. Spielberg hit gold yet one more time with Raiders of the Lost Ark (1981), with Harrison Ford taking the part of Indiana Jones. Spielberg produced and directed two films in 1982. The first was Poltergeist (1982), but the highest-grossing movie of all time up to that point was the alien story E.T. The Extra-Terrestrial (1982). Spielberg also helped pioneer the practice of product placement. The concept, while not uncommon, was still relatively low-key when Spielberg raised the practice to almost an art form with his famous (or infamous) placement of Reese s Pieces in "E.T." Spielberg was also one of the pioneers of the big-grossing special-effects movies, like "E.T." and "Close Encounters", where a very strong emphasis on special effects was placed for the first time on such a huge scale. In 1984, Spielberg followed up "Raiders" with Indiana Jones and the Temple of Doom (1984), which was a commercialsuccess but did not receive the critical acclaim of its predecessor. As a producer, Spielberg took on many projects in the 1980s, such as The Goonies (1985), and was the brains behind the little monsters in Gremlins (1984). He also produced the cartoon An American Tail (1986),a quaint little animated classic. His biggest effort as producer in 1985, however, was the blockbuster Back to the Future (1985), which made Michael J. Fox an instant superstar. As director, Spielberg took on the book The Color Purple (1985), with Whoopi Goldberg and Oprah Winfrey, with great success. In the latter half of the 1980s, he also directed Empire of the Sun (1987), a mixed success for the occasionally erratic Spielberg. Success would not escape him for long, though.\n\nThe late 1980s found Spielberg s projects at the center of pop-culture yet again. In 1988, he produced the landmark animation/live-action film Who Framed Roger Rabbit (1988). The next year proved to be another big one for Spielberg, as he produced and directed Always (1989) aswell as Indiana Jones and the Last Crusade (1989), and Back to the Future Part II (1989). All three of the films were box-office and critical successes. Also, in 1989, he produced the little known comedy-drama Dad (1989), with Jack Lemmon and Ted Danson, which got mostly mixedresults. Spielberg has also had an affinity for animation and has been a strong voice in animation in the 1990s. Aside from producing the landmark "Who Framed Roger Rabbit", he produced the animated series Tiny Toon Adventures (1990), Animaniacs (1993), Pinky and the Brain (1995), Freakazoid! (1995), Pinky, Elmyra & the Brain (1998), Family Dog (1993) and Toonsylvania (1998). Spielberg also produced other cartoons such as The Land Before Time (1988), We re Back! A Dinosaur s Story (1993), Casper (1995) (the live action version) as well as the live-action version of The Flintstones (1994), where he was credited as "Steven Spielrock". Spielberg also produced many Roger Rabbit short cartoons, and many Pinky and the Brain, Animaniacs and Tiny Toons specials. Spielberg was very active in the early 1990s, as he directed Hook (1991) and produced such films as the cute fantasy Joe Versus the Volcano (1990) and An American Tail: Fievel Goes West (1991). He also produced the unusual comedy thriller Arachnophobia (1990), Back to the Future Part III (1990) and Gremlins 2: The New Batch (1990). While these movies were big successes in their own right, they did not quite bring in the kind of box office or critical acclaim as previous efforts. In 1993, Spielberg directed Jurassic Park (1993), which for a short time held the record as the highest grossing movie of all time, but did not have the universal appeal of his previous efforts. Big box-office spectacles were not his only concern, though. He produced and directed Schindler s List (1993), a stirring film about the Holocaust. He won best director at the Oscars, and also got Best Picture. In the mid-90s, he helped found the production company DreamWorks, which was responsible for many box-office successes.\n\nAs a producer, he was very active in the late 90s, responsible for such films as The Mask of Zorro (1998), Men in Black (1997) and Deep Impact (1998). However, it was on the directing front that Spielberg was in top form. He directed and produced the epic Amistad (1997), a spectacular film that was shorted at the Oscars and in release due to the fact that its release date was moved around so much in late 1997. The next year, however, produced what many believe was one of the best films of his career: Saving Private Ryan (1998), a film about World War Two that is spectacular in almost every respect. It was stiffed at the Oscars, losing best picture to Shakespeare in Love (1998).\n\nSpielberg produced a series of films, including Evolution (2001), La maldición (1999) and Shrek (2001). he also produced two sequels to Jurassic Park (1993), which were financially but not particularly critical successes. In 2001, he produced a mini-series about World War Two that definitely *was* a financial and critical success: Band of Brothers (2001), a tale of an infantry company from its parachuting into France during the invasion to the Battle of the Bulge. Also in that year, Spielberg was back in the director s chair for A.I. Artificial Intelligence (2001), a movie with a message and a huge budget. It did reasonably at the box office and garnered varied reviews from critics.\n\nSpielberg has been extremely active in films there are many other things he has done as well. He produced the short-lived TV series SeaQuest 2032 (1993), an anthology series entitled Amazing Stories (1985), created the video-game series "Medal of Honor" set during World War Two, and was a starting producer of ER (1994). Spielberg, if you haven t noticed, has a great interest in World War Two. He and Tom Hanks collaborated on Shooting War (2000), a documentary about World War II combat photographers, and he produced a documentary about the Holocaust called Eyes of the Holocaust (2000). With all of this to Spielberg s credit, it s no wonder that he s looked at as one of the greatest everfigures in entertainment.
3	Ridley Scott	data:image/png;base64,	Described by film producer Michael Deeley as "the very best eye in the business", director Ridley Scott was born on November 30, 1937 in South Shields, Tyne and Wear (then County Durham). His father was an officer in the Royal Engineers and the family followed him as his career posted him throughout the United Kingdom and Europe before they eventually returned to Teesside. Scott wanted to join the Royal Army (hiselder brother Frank had already joined the Merchant Navy) but his father encouraged him to develop his artistic talents instead and so he went to West Hartlepool College of Art and then London s Royal College of Art where he helped found the film department.\n\nIn 1962, he joined the BBC as a trainee set designer working on several high profile series. He attended a trainee director s course whilehe was there and his first directing job was on an episode of the popular BBC police series Z Cars (1962), Z Cars: Error of Judgement (1965). More TV work followed until, frustrated by the poor financial rewards at the BBC, he went into advertising. With his younger brother, Tony Scott, he formed the advertising production company RSA (Ridley Scott Associates) in 1967 and spent the next 10 years making some of the best known and best loved TV adverts ever shown on British television, including a series of ads for Hovis bread set to the music of Dvorak s New World Symphony which are still talked about today (" e were a great baker were our dad.")\n\nHe began working with producer David Puttnam in the 1970s developing ideas for feature films. Their first joint endeavor, The Duellists (1977) won the Jury Prize for Best First Work at Cannes in 1977 and was nominated for the Palm d Or, more than successfully launching Scott sfeature film career. The success of Star Wars: Episode IV - A New Hope (1977) inspired Scott s interest in making science fiction and he accepted the offer to direct Dan O Bannon s low budget science fiction horror movie Alien (1979), a critical and commercial success that firmly established his worldwide reputation as a movie director.\n\nBlade Runner (1982) followed in 1982 to, at best, a lukewarm reception from public and critics but in the years that followed, its reputation grew - and Scott s with it - as one of the most important sci-fi movies ever made. Scott s next major project was back in the advertising world where he created another of the most talked-about advertising spots in broadcast history when his "1984"-inspired ad for the new Apple Macintosh computer was aired during the Super Bowl on January 22, 1984. Scott s movie career has seen a few flops (notably Legend (1985) and 1492: Conquista del paraíso (1992)), but with successes like Thelma & Louise (1991), Gladiator (2000) and Black Hawk Down (2001) to offset them, his reputation remains solidly intact.\n\nRidley Scott was awarded Knight Bachelor of the Order of the British Empire at the 2003 Queen s New Year Honours for his "substantial contribution to the British film industry". On July 3, 2015, he was awarded an honorary doctorate by the Royal College of Art in a ceremony at the Royal Albert Hall in London. He was awarded the BAFTA Fellowship in 2018. BAFTA described him as "a visionary director, one of the great British film-makers whose work has made an indelible mark on the history of cinema. Forty years since his directorial debut, his films continue to cross the boundaries of style and genre, engaging audiences and inspiring the next generation of film talent."
4	Quentin Tarantino	data:image/png;base64,	Quentin Jerome Tarantino was born in Knoxville, Tennessee. His father, Tony Tarantino, is an Italian-American actor and musician from New York, and his mother, Connie (McHugh), is a nurse from Tennessee. Quentin moved with his mother to Torrance, California, when he was four years old.\n\nIn January of 1992, first-time writer-director Tarantino s Reservoir Dogs (1992) appeared at the Sundance Film Festival. The film garneredcritical acclaim and the director became a legend immediately. Two years later, he followed up Dogs success with Pulp Fiction (1994) whichpremiered at the Cannes film festival, winning the coveted Palme D Or Award. At the 1995 Academy Awards, it was nominated for the best picture, best director and best original screenplay. Tarantino and writing partner Roger Avary came away with the award only for best originalscreenplay. In 1995, Tarantino directed one fourth of the anthology Four Rooms (1995) with friends and fellow auteurs Alexandre Rockwell, Robert Rodriguez and Allison Anders. The film opened December 25 in the United States to very weak reviews. Tarantino s next film was From Dusk Till Dawn (1996), a vampire/crime story which he wrote and co-starred with George Clooney. The film did fairly well theatrically.\n\nSince then, Tarantino has helmed several critically and financially successful films, including Jackie Brown (1997), Kill Bill: Vol. 1 (2003), Kill Bill: Vol. 2 (2004), Inglourious Basterds (2009), Django Unchained (2012) and The Hateful Eight (2015).
5	Alfonso Cuarón	data:image/png;base64,	Alfonso Cuarón Orozco was born on November 28th in Mexico City, Mexico. From an early age, he yearned to be either a film director or an astronaut. However, he did not want to enter the army, so he settled for directing. He didn t receive his first camera until his twelfth birthday, and then immediately started to film everything he saw, showing it afterwards to everyone. In his teen years, films were his hobby. Sometimes he said to his mother he would go to a friend s home, when in fact he would go to the cinema. His ambition was to know every theatre in the city. Near his house there were two studios, Studios Churubusco and Studios 212. After finishing school, Cuarón decided to studycinema right away. He tried to study at C.C.C. (Centro de Capacitación Cinematográfica) but wasn t accepted because at that time they weren t accepting students under twenty-four years old. His mother didn t support that idea of cinema, so he studied philosophy in the morning and in the afternoon he went to the C.U.E.C. (Centro Universitario de Estudios Cinematográficos). During that time he met many people who would later become his collaborators and friends. One of them was Luis Estrada. Cuaron also became good friends with Carlos Marcovich and Emmanuel Lubezki. Luis Estrada directed a short called "Vengance is Mine", on which Alfonso and Emmanuel collaborated. The film was in English, a fact which bothered many teachers of the C.U.E.C. such as Marcela Fernández Violante. The disagreement caused such arguments that in 1985, Alfonso was expelled from the university.\n\nDuring his time studying at C.U.E.C. he met Mariana Elizondo, and with her he had his first son, Jonás Cuarón. After Alfonso was expelled,he thought he could never be a director and so went on to work in a Museum so he could sustain his family. One day, José Luis García Agrazand Fernando CáMara went to the museum and made an offer to Cuarón. They asked him to work as cable person in "La víspera (1982)", a job which was to prove to be his salvation. After that he was assistant director in Garcia Agraz s "Nocaut (1984)", as well as numerous other films.\n\nHe was also second unit director in "Gaby: A True Story (1987)", and co-wrote and directed some episodes in the series "A Hora Marcada (1967)". One New Year s Eve, he decided he would not continue to be an assistant director, and with his brother Carlos started writing what would be his first feature film: "Sólo con Tu Pareja (1991)" (Love in the time of Hysteria). After the screenplay was written, the problem became how to get financial backing for the movie. I.M.C.I.N.E. (Instituto Mexicano de Cinematografia), which supports movies financially, had already decided which projects it would support that year, much to Alfonso s initial chagrin. However, the director of one of those already-chosen projects was unable to direct it, so his project was canceled, and "Sólo con tu pareja" took its place. Despite this being chosen, there was a lot of tension between Alfonso and the I.M.C.I.N.E. executives. Nevertheless, after the movie was finished, it was a huge success. In Toronto festival the films won many awards, and Alfonso started to be noticed by Hollywood producers. Sydney Pollack was the firstone to invite him to shoot in Hollywood. He proposed a feature film to be directed by Alfonso, but the project didn t work and was canceled. Alfonso moved to Los Angeles without anything concrete, and stayed with some friends, as he had no money. Soon after that, Pollack called him again to direct an episode called "Fallen Angels: Murder, Obliquely (1993)" of the series "Fallen Angels (1993)", that was the first job he had in U.S., and also the first time he worked with Alan Rickman.\n\nAfter a while, and no real directing jobs, Alfonso wanted to direct something as he needed money. He finally signed a contract with WarnerBrothers to direct the film Addicted to Love (1995). However, one night, he read the screenplay for another film, A Little Princess (1995)and fell in love with it. He talked to Warner Brothers and after some meetings he gave up directing "Addicted to Love" in order to do "A Little Princess". Even thought it wasn t a great box office success, the film received two nominations for the Oscars, and won many other awards. After "A Little Princess" Alfonso developed a project with Richard Gere starring. The project was canceled, but Cuarón got an offer from Twentieth Century Fox to direct the modern adaptation of the Charles Dickens  classic Great Expectations (1998). He initially didn t want to direct it but the studio insisted, and in the end he accepted it. The experience was very painful and difficult for him mainly because there was never a definitive screenplay.\n\nHe then reunited with producer Jorge Vergara and founded both Anhelo Productions and Moonson Productions. Anhelo s first picture was also Alfonso s next film, the erotic road movie "Y Tu Mamá También (2001)", which was a huge success. During the promotion of the film in Venice, Alfonso met the cinema critic Annalisa Bugliani. They started dating and married that same year. "Children of Men (2006)" was to be Alfonso s next film, a futuristic, dystopian story. During the preproduction of the film, Warner Brothers invited Alfonso to direct the third Harry Potter film, "Harry Potter and the Prisoner of Azkaban (2004)", an offer which he accepted after some consideration. The film would prove to be the greatest box office success of his career.\n\nIn 2003, he had a daughter named Tess Bu Cuarón, and in February 2005 another son, called Olmo Teodoro Cuarón. Alfonso Cuarón signed a three-year first-look deal with Warner Brothers, which allowed his films to be distributed world-wide. As a result of that deal, he developed two new projects, _History of Love, The (2007)_ and _Memory of Running, The (2007)_. He also developed another Mexican film "_México  68 (2007)_", about the violent students  revolt that happened in Mexico in 1968. He directed one five-minute segment of the anthology film Paris, je t aime (2006) with Nick Nolte and Ludivine Sagnier. His next project, the futuristic film Children of Men (2006) with Clive Owen, Julianne Moore and Michael Caine premiered at the Venice Film Festival in 2006 having been nominated for three Academy Awards. After his youngest son was diagnosed with autism and the divorce from Annalisa Bugliani he took a break from directing and settled in London where he plansto work on his next projects.\n\nIn 2013, Alfonso directed the space thriller Gravity (2013), which would go win 7 academy awards.
6	Peter Jackson	data:image/png;base64,	Peter Jackson was born as an only child in a small coast-side town in New Zealand in 1961. When a friend of his parents bought him a super8 movie camera (because she saw how much he enjoyed taking photos), the then eight-year-old Peter instantly grabbed the thing to start recording his own movies, which he made with his friends. They were usually short, but they already had the trademark that would make Jackson famous: impressive special effects, made at a very low cost. For example, for his film "World War Two" which he made as a teenager, he usedto simulate a firing gun by punching little holes into the celluloid, so that, once projected, the gun gave the impression of displaying asmall fire. Jackson s first step towards more serious film-making came with an entry in a local contest to stimulate amateur and children s films. For this film, he used stop-motion animation to create a monster that ruins a city in the style of Ray Harryhausen. Unfortunately,he didn t win. At twenty-two, he embarked on a movie-making adventure that would change his life. This film, Mal gusto (1987), was begun as any other Jackson film, in an amateur style, at a low budget and using friends and local people to star in his film. Jackson himself did nearly everything in the movie; he directed, produced, filmed and starred in it, in a number of roles, amongst them that of the hero, "Derek". And everything was filmed on a second-hand, $250 camera. It took Jackson and his friends four years to complete the movie. What had started as a joke in a group of friends, then became a cult classic. A friend of Jackson who was working in the movie industry convinced him the film had commercial prospects and arranged for it to be shown at the Cannes film festival, where it won a lot of acclaim, as well as a number of prizes. The movie soon became a hit because of its bizarre humor and overdose of special effects, some realistic, some comedicallyamateur. After the success of Mal gusto (1987), Jackson became recognized as a director and the door to fame and fortune was opened. He gave up his job at a local photographer s shop and became a well-known director of horror-movies, after the success of his first professionally made movie, Dead Alive (1992).
