1	Gravity	2013	data:image/jpeg;base64,	t	5	5	Gravity stars Sandra Bullock and George Clooney in a heart-pounding thriller that pulls you into the infinite and unforgiving realm of deep space. Bullock plays Dr. Ryan Stone, a brilliant medical engineer on her first shuttle mission, with veteran astronaut Matt Kowalsky (Clooney). But on a seemingly routine spacewalk, disaster strikes. The shuttle is destroyed, leaving Stone and Kowalsky completely alone - tethered to nothing but each other and spiraling out into the blackness. The deafening silence tells them they have lost any link to Earth and any chance for rescue. As fear turns to panic, every gulp of air eats away at what little oxygen is left. But the only way home may be to go further out into the terrifying expanse of space. -- (C) Warner Bros.
2	E.T.	1982	data:image/jpeg;base64,	t	5	2	Both a classic movie for kids and a remarkable portrait of childhood, E.T. is a sci-fi adventure that captures that strange moment in youth when the world is a place of mysterious possibilities (some wonderful, some awful), and the universe seems somehow separate from the one inhabited by grown-ups. Henry Thomas plays Elliott, a young boy living with his single mother (Dee Wallace), his older brother Michael (Robert MacNaughton), and his younger sister Gertie (Drew Barrymore). Elliott often seems lonely and out of sorts, lost in his own world. One day, while looking for something in the back yard, he senses something mysterious in the woods watching him. And he s right: an alien spacecraft on a scientific mission mistakenly left behind an aging botanist who isn t sure how to get home. Eventually Elliott puts his fears aside and makes contact with the "little squashy guy," perhaps the least threatening alien invader ever to hit a movie screen. As Elliott tries to keep the alien under wraps and help him figure out a way to get home, he discovers that the creature can communicate with him telepathically. Soon they begin to learn from each other, and Elliott becomes braver and less threatened by life. E.T. rigs up a communication device from junk he finds around the house, but no one knows if he ll be rescued before a group of government scientists gets hold of him. In 2002, Steven Spielberg re-released E.T. The Extra-Terrestrial in a revised edition, with several deleted scenes restored and digitally refurbished special effects. ~ Mark Deming, Rovi
3	The Lord of the Rings: The Fellowship of the Ring	2001	data:image/jpeg;base64,	t	6	6	Assisted by a Fellowship of heroes, Frodo Baggins plunges into a perilous trek to take the mystical One Ring to Mount Doom so that it and its magical powers can be destroyed and never possessed by evil Lord Sauron. The astonishing journey begins in the first film of director/co-writer Peter Jackson s epic trilogy that redefined fantasy filmmaking. This imaginative foray into J.R.R. Tolkien s Middle-earth won 4 Academy Awards (R)* and earned 13 total nominations including Best Picture.
4	The Post	2017	data:image/jpeg;base64,	t	2	2	Steven Spielberg directs Meryl Streep and Tom Hanks in The Post, a thrilling drama about the unlikely partnership between The Washington Post s Katharine Graham (Streep), the first female publisher of a major American newspaper, and editor Ben Bradlee (Hanks), as they race to catch up with The New York Times to expose a massive cover-up of government secrets that spanned three decades and four U.S. Presidents. The two must overcome their differences as they risk their careers -- and their very freedom -- to help bring long-buried truths to light. The Post marks the first time Meryl Streep, Tom Hanks and Steven Spielberg have collaborated on a project. In addition to directing, Spielberg produces along with Amy Pascal and Kristie Macosko Krieger. The script was written by Liz Hannah and Josh Singer, and the film features an acclaimed ensemble cast including Alison Brie, Carrie Coon, David Cross, Bruce Greenwood, Tracy Letts, Bob Odenkirk, Sarah Paulson, Jesse Plemons, Matthew Rhys, Michael Stuhlbarg, Bradley Whitford and Zach Woods.
5	Taxi Driver	1976	data:image/jpeg;base64,	t	2	1	"All the animals come out at night" -- and one of them is a cabby about to snap. In Martin Scorsese s classic 1970s drama, insomniac ex-Marine Travis Bickle (Robert De Niro) works the nightshift, driving his cab throughout decaying mid-70s New York City, wishing for a "real rain" to wash the "scum" off the neon-lit streets. Chronically alone, Travis cannot connect with anyone, not even with such other cabbies as blowhard Wizard (Peter Boyle). He becomes infatuated with vapid blonde presidential campaign worker Betsy (Cybill Shepherd), who agrees to a date and then spurns Travis when he cluelessly takes her to a porno movie. After an encounter with a malevolent fare (played by Scorsese), the increasingly paranoid Travis begins to condition (and arm) himself for his imagined destiny, a mission that mutates from assassinating Betsy s candidate, Charles Palatine (Leonard Harris), to violently "saving" teen hooker Iris (Jodie Foster) from her pimp, Sport (Harvey Keitel). Travis bloodbath turns him into a media hero; but has it truly calmed his mind? Written by Paul Schrader, Taxi Driver is an homage to and reworking of cinematic influences, a study of individual psychosis, and an acute diagnosis of the latently violent, media-fixated Vietnam era. Scorsese and Schrader structure Travis mission to save Iris as a film noir version of John Ford s late Western The Searchers (1956), aligning Travis with a mythology of American heroism while exposing that myth s obsessively violent underpinnings. Yet Travis military record and assassination attempt, as well as Palatine s political platitudes, also ground Taxi Driver in its historical moment of American in the 1970s. Employing such techniques as Godardian jump cuts and ellipses, expressive camera moves and angles, and garish colors, all punctuated by Bernard Herrmann s eerie final score (finished the day he died), Scorsese presents a Manhattan skewed through Travis point-of-view, where De Niro s now-famous "You talkin to me" improv becomes one more sign of Travis madness. Shot during a New York summer heat wave and garbage strike, Taxi Driver got into trouble with the MPAA for its violence. Scorsese desaturated the color in the final shoot-out and got an R, and Taxi Driver surprised its unenthusiastic studio by becoming a box-office hit. Released in the Bicentennial year, after Vietnam, Watergate, and attention-getting attempts on President Ford s life, Taxi Driver s intense portrait of a man and a society unhinged spoke resonantly to the mid-70s audience -- too resonantly in the case of attempted Reagan assassin and Foster fan John W. Hinckley. Taxi Driver went on to win the Palme dOr at the Cannes Film Festival, but it lost the Best Picture Oscar to the more comforting Rocky. Anchored by De Niro s disturbing embodiment of "God s lonely man," Taxi Driver remains a striking milestone of both Scorsese s career and 1970s Hollywood. ~ Lucia Bozzola, Rovi
6	Reservoir Dogs	1992	data:image/jpeg;base64,	t	4	4	In 1992, Reservoir Dogs transformed Quentin Tarantino practically overnight from an obscure, unproduced screenwriter and part-time actor to the most influential new filmmaker of the 1990s. The story looks at what happens before and after (but not during) a botched jewelry store robbery organized by Joe Cabot (Lawrence Tierney). Mr. White (Harvey Keitel) is a career criminal who takes a liking to newcomer Mr. Orange (Tim Roth) and enjoys showing him the ropes. Mr. Pink (Steve Buscemi) is a weaselly loner obsessed with professionalism. Mr. Blonde (Michael Madsen) has just gotten out of jail after taking the rap on a job for Cabot; he s grateful for the work but isn t the same person he used to be. While Mr. Blonde goes nuts during the heist, the thieves are surprised by the sudden arrival of the police, and Mr. Pink is convinced one of their team is a cop. So who s the rat? What do they do about Mr. Blonde? And what do they do with Mr. Orange, who took a bullet in the gut and is slowly bleeding to death? Reservoir Dogs jumps back and forth between pre- and post-robbery events, occasionally putting the narrative on pause to let the characters discuss such topics as the relative importance of tipping, who starred in Get Christie Love!, and what to do when you enter a men s room full of cops carrying a briefcase full of marijuana. ~ Mark Deming, Rovi
7	Kill Bill: Vol. 1	2003	data:image/jpeg;base64,	t	1	4	An entire wedding party is slaughtered during a dress rehearsal in a rural chapel: the pregnant woman in the blood-splattered wedding dress is Black Mamba, better known as The Bride. The assassin, Bill, and his circle known as The Vipers left The Bride for dead, but unluckily for them she was merely comatose. Four years later, The Bride suddenly awakens from her coma and realizes what has been done to her. She sets off on a ferociously focused mission, setting out to seek revenge on her former master and his deadly squad of assassins. One by one, she kills the various members of the assassin group. She saves Bill for last.
